import React from 'react';

const arrivalSteps = [
  { icon: 'üìù', title: 'Apply for SIN', desc: 'Social Insurance Number for work and taxes' },
  { icon: 'üè¶', title: 'Open Bank Account', desc: 'Secure your Canadian banking access' },
  { icon: 'üì±', title: 'Get a SIM Card', desc: 'Local phone number for easy communication' },
  { icon: 'ü©∫', title: 'Apply for Health Card', desc: 'MSP (BC), OHIP (Ontario) and others' },
  { icon: 'üöå', title: 'Transit Setup', desc: 'Get Compass/Presto card for public transport' },
  { icon: 'üí≥', title: 'Build Credit History', desc: 'Start your financial journey in Canada' },
  { icon: 'üè†', title: 'Find Housing', desc: 'Explore rentals and shared accommodations' },
  { icon: 'üéì', title: 'Newcomer Orientation', desc: 'Register for guidance and support programs' },
];

export default function NewInCanada() {
  return (
    <div className="mb-10">
      <h2 className="text-xl font-semibold mb-4">New in Canada Services</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
        {arrivalSteps.map((step, index) => (
          <div key={index} className="bg-white border rounded-lg p-4 shadow hover:shadow-md transition">
            <div className="text-3xl mb-2">{step.icon}</div>
            <h3 className="text-md font-bold mb-1">{step.title}</h3>
            <p className="text-sm text-gray-600">{step.desc}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
